  // Here you'd return an array of routes
  const user = useSelector(selectUser);
  // const [loading, setLoading] = useState(true);
  const dispatch = useDispatch();

  useEffect(() => {
    getAccessToken().then(token => {
      dispatch(
        login({
          accessToken: token
        })
      );
      // setLoading(false);
    })
  }, []);

  return <div>{user?(<Discover />):(<h2>Wrong</h2>)}</div>;
}
